import React from "react";

function HashTagTech(props)
{
    return(
        <p
        style={{
            fontWeight: "lighter",
            fontSize: props.fontSize,
            color:props.color,
            textAlign: center
            }}>#TECH</p>
    );
}

export default HashTagTech;
